import Iframe from 'react-iframe'

export default function Maps()  {
    return (
        <div style={{ height: "30vh" }}>
        <Iframe
          url="https://www.google.com/maps/@24.0218509,-104.6525996,3a,75y,300.21h,65.84t/data=!3m6!1e1!3m4!1sFjJ4ZQAvRAfevQs156qmDA!2e0!7i16384!8i8192?entry=ttu"
          width="100%"
          height="100%"
          frameBorder="0"
          allowFullScreen
          loading="lazy"
          referrerPolicy="no-referrer-when-downgrade"
        />
      </div>
    );
}
